import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import {Nav, Navbar, Tab, Row, Col, Form} from 'react-bootstrap'
import styled from 'styled-components';
import { motion} from "framer-motion";

//logo
import logo from '../assets/PneuS-03.png'

const Styles = styled.div`
height: 100vh;
display: grid;
  grid-template: repeat(10, [row] 1fr) / repeat(2, [col] 1fr);

  .item-1 {
  grid-column: col 1 / span 2;
  grid-row: row 1 ;
  background: linear-gradient(to left, #6441a5, #2a0845);
  opacity: 0;

}


.item-3 {
  grid-column: col 1;
  grid-row: row 2 / span 10 ;
  background: linear-gradient(to top, #d38312, #a83279);
  z-index: -1;
  opacity: 0.8;
}

.item-4 {
  grid-column: col 2 / span 2;
  grid-row: row 2 / span 10 ;
  background: linear-gradient(to left, #b3ffab, #12fff7);
}

.item-5 {
  grid-column: col 1 / span 2;
  grid-row: row 10 / span 3;
  background: linear-gradient(to top, #485563, #29323c);
}

.item-6 {
  grid-column: col 2 / span 3;
  grid-row: row 3;
  background: linear-gradient(to right, #fe8c00, #f83600);
  opacity: 0.8;
}

`;

function Header(props){
    return(
        <React.Fragment>
            <Styles>
                    <div className='item-1'> 1 </div>
                    <div className='item-3'> 3 </div>
                    <div className='item-4'> 4 </div>
                    <div className='item-5'> 5 </div>
            </Styles>
        </React.Fragment>
    )
}
export default Header;
